script: |
  super -f tsv -I q9650.sql | sort > q9650.out

vector: true

inputs:
  - name: q9650.sql
    data: |
      SELECT ALL - ( COALESCE ( - 70, + 44 + + - 63 + MIN ( ALL - 80 ) * - + COALESCE ( 48, 93 ) / + + 82 * + ( - 1 ) * + 60 - + + CAST ( - - 50 AS INTEGER ) ) ) AS col1, + ( + 72 ) + + 85 AS col0;

outputs:
  - name: q9650.out
    data: |
      70	157
